  {
    Header: 'Session ID',
    accessor: 'itemId'
  },
  {
    Header: 'Org ID',
    accessor: 'sessionOrgId'
  },
  {
    Header: 'Test ID',
    accessor: 'sessionTestId'
  },
  {
    Header: 'Test Name',
    accessor: 'description'
  },
  {
    Header: 'User ID',
    accessor: 'id'
  },
  {
    Header: 'User First Name',
    accessor: 'firstName'
  },
  {
    Header: 'User Last Name',
    accessor: 'lastName'
